```
–ê–Ω–æ–Ω–∏–º–Ω–∞—è —Ñ—É–∫–Ω—Ü–∏—è –∏–º–µ–µ—Ç –¥–æ—Å—Ç—É–ø –∫ –≤–Ω–µ—à–Ω–µ–π –∑–æ–Ω–µ –≤–∏–¥–∏–º–æ—Å—Ç–∏.
–î–ª—è —Å–æ–∑–¥–∞–Ω–∏—è —Ä–µ–∫—É—Ä—Å–∏–≤–Ω—ã—Ö –∞–Ω–æ–Ω–∏–º–Ω—ã—Ö —Ñ—É–Ω–∫—Ü–∏–π –Ω–µ–æ–±—Ö–æ–¥–∏–º–æ –æ–±—ä—è–≤–∏—Ç—å —Å–Ω–∞—á–∞–ª–∞ [[go.–∫–æ–Ω—Å–ø–µ–∫—Ç.–ø–µ—Ä–µ–º–µ–Ω–Ω—ã–µ#–ü–µ—Ä–µ–º–µ–Ω–Ω—ã–µ|–ø–µ—Ä–µ–º–µ–Ω–Ω—É—é]] —Å —Ç–∏–ø–æ–º –Ω—É–∂–Ω–æ–π —Å–∏–≥–Ω–∞—Ç—É—Ä—ã","–∞ –∑–∞—Ç–µ–º –ø—Ä–∏—Å–≤–æ–∏—Ç—å [[go.–∫–æ–Ω—Å–ø–µ–∫—Ç.–ø–µ—Ä–µ–º–µ–Ω–Ω—ã–µ#–ü–µ—Ä–µ–º–µ–Ω–Ω—ã–µ|–ø–µ—Ä–µ–º–µ–Ω–Ω–æ–π]] —ç—Ç—É —Ñ—É–Ω–∫—Ü–∏—é","–≤—ã–∑—ã–≤–∞—è –≤ –Ω–µ–π –Ω–µ—ë –∂–µ —á–µ—Ä–µ–∑ —ç—Ç—É [[go.–∫–æ–Ω—Å–ø–µ–∫—Ç.–ø–µ—Ä–µ–º–µ–Ω–Ω—ã–µ#–ü–µ—Ä–µ–º–µ–Ω–Ω—ã–µ|–ø–µ—Ä–µ–º–µ–Ω–Ω—É—é]].
–í–æ–∑–º–æ–∂–µ–Ω –≤–æ—Ç —Ç–∞–∫–æ–π –ø—Ä–∏–∫–æ–ª:
```go
