- –ü–µ—Ä–µ–º–µ–Ω–Ω—ã–µ","–æ–±—ä—è–≤–ª–µ–Ω–Ω—ã–µ –≤ –ª—é–±–æ–π —á–∞—Å—Ç–∏ `if` –±—É–¥—É—Ç –Ω–∞—Ö–æ–¥–∏—Ç—å—Å—è –≤ –∑–æ–Ω–µ –¥–µ–π—Å—Ç–≤–∏—è –≤—Å–µ–≥–æ –≤—ã—Ä–∞–∂–µ–Ω–∏—è."}

{"## http.Get()
```go
func Get(url string) (resp *Response","err error)
```
–í—ã–ø–æ–ª–Ω—è–µ—Ç http –∑–∞–ø—Ä–æ—Å –∏ –ø—Ä–∏ –æ—Ç—Å—É—Ç—Å—Ç–≤–∏–∏ –æ—à–∏–±–æ–∫ –≤–æ–∑–≤—Ä–∞—â–∞–µ—Ç —Å—Å—ã–ª–∫—É –Ω–∞ —Å—Ç—Ä—É–∫—Ç—É—Ä—É rest.
rest.Body - —Å–æ–¥–µ—Ä–∂–∏—Ç –ø–æ—Ç–æ–∫ –¥–ª—è —á—Ç–µ–Ω–∏—è","–∫–æ—Ç–æ—Ä—ã–π –º–æ–∂–Ω–æ —Å—á–∏—Ç–∞—Ç—å —Å –ø–æ–º–æ—â—å—é ioutil.ReadAll(rest.Body). –ü–æ—Å–ª–µ —ç—Ç–æ–≥–æ –µ–≥–æ –Ω–µ–æ–±—Ö–æ–¥–∏–º–æ –∑–∞–∫—Ä—ã—Ç—å —Å –ø–æ–º–æ—â—å—é –º–µ—Ç–æ–¥–∞ Close()."}

{"### –í–∏–¥
