### –ü—Ä–∏–º–µ—á–∞–Ω–∏—è
- –í—Å–µ —á–∞—Å—Ç–∏ –æ–ø—Ü–∏–æ–Ω–∞–ª—å–Ω—ã –∏ –º–æ–≥—É—Ç –Ω–µ —É–∫–∞–∑—ã–≤–∞—Ç—å—Å—è. –ï—Å–ª–∏ –Ω–µ —É–∫–∞–∑—ã–≤–∞–µ—Ç—Å—è `condition`","—Ç–æ –ø–æ–¥—Å—Ç–∞–≤–ª—è–µ—Ç—Å—è `true`."}
